(5769, 'Finalizado', '2025-09-11 15:30:33', 2356, 446, 'Feita a visita e a auxiliar queria que fosse instalado algum dos computadores que estavam inativos na sala da prótese. Ao todo havia quatro computadores  inativos todos funcionando somente um deles esta com a placa mãe ultrapassada tal qual se for utilizar este computador haverá problemas de lentidão. Foi separado o computador da sala da prótese, não foi concluída a instalação do mesmo pois faltou o cabo de energia para que pudesse ligar o monitor e a cpu pois não havia nenhum com o técnico presente e na clinica também não havia destes cabos guardados. Será necessário também o cabo de força para uma impressora que querem reativa-la na recepção do primeiro andar.', '2025-09-11 15:30:33', NULL),
